import React, { useState } from 'react';

const Counter = ({}) => {
  const [count, setCount] = useState(0);

  const incrementCount = value => setCount(count => count + value);

  const decrementCount = value => setCount(count => count - value);

  return (
    <div style={{ display: 'flex', margin: '48px 0' }}>
      <button onClick={() => decrementCount(4)}>-4</button>
      <button onClick={() => decrementCount(2)}>-2</button>
      <button onClick={() => decrementCount(1)}>-</button>
      <div style={{ margin: '0 24px' }}>Count: {count}</div>
      <button onClick={() => incrementCount(1)}>+</button>
      <button onClick={() => incrementCount(2)}>+2</button>
      <button onClick={() => incrementCount(4)}>+4</button>
    </div>
  );
};

export default Counter;
